import { Block } from "@material-ui/icons";
import "./Card.css";
import imgs from "./data";
import "./Offer.css";
const Card = ({ property }) => {
  const index = property;
  imgs.properties.map((picture) => {
    if (imgs.properties.index === property)
      return (
        <div id={"card-${index}"} className="card">
          <img src={imgs.property.picture} className="image"></img>
        </div>
      );
  });
  return (
    <div id={"card-${index}"} className="card">
      <img src={picture} className="image"></img>
    </div>
  );
};
export default Card;
